import React, { Component } from "react";

import { InfoSection } from "./InfoSection";
import { InteractiveSection } from "./InteractiveSection";

export class Main extends Component {
  state = {
    char: {}
  };

  handleClick = () => {};

  render() {
    return (
      <div className="Container">
        <InfoSection />
        <InteractiveSection />
      </div>
    );
  }
}
